var title_f43_35_44603="Suggested colic strategies";
var content_f43_35_44603=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F73784&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F73784&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested strategies for managing colic",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Change formula from cow's milk to soy-based or to hydrolysate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If breastfeeding, have mother eliminate milk-based products and caffeine and begin hypoallergenic diet",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Change nipple or bottle, feed in an upright position with frequent burping",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Supplemental daytime carrying or front carrier",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Place car seat in a secure position on dishwasher or clothes dryer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ride in the car",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Change of scenery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pacifier",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Swing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Belly massage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Swaddling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Heartbeat tape or white noise generator",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hot-water bottle on belly (avoid making water too hot, as it may cause burns)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        SleepTight&reg; (device that generates white noise and vibrates the bed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Warm bath",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Herbal tea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sucrose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Simethicone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Parental support",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antispasmodics (should not be used secondary to risk of severe adverse effects)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    This is a list of strategies that have been recommended. Not all strategies have been evaluated in randomized controlled trials. They are listed randomly, not as a step-by-step plan to follow.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
