var title_f43_35_44605="tPA versus streptokinase in MI";
var content_f43_35_44605=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71194&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71194&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 522px\">",
"   <div class=\"ttl\">",
"    tPA is superior to streptokinase for acute MI",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 502px; height: 274px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    30-day mortality in acute MI with four different thrombolytic regimens: streptokinase (with subcutaneous heparin or intravenous heparin), accelerated tPA and intravenous heparin, and combination therapy with streptokinase, tPA, and IV heparin. There was a significant 1 percent absolute reduction in mortality with tPA (6.3 versus pooled value of 7.3 percent with the other regimens).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from The GUSTO Investigators, N Engl J Med 1993; 329:673.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
